import React, { Component } from "react";

const Card = (props) => {
  return (
    <div
      OnClick={props.OnClick}
      className="card grid-item"
      style={{ background: props.card.color }}
    >
      <h2>soy la carta nro {props.card.id}</h2>
    </div>
  );
};

export default Card;
